import { createMuiTheme } from '@material-ui/core/styles';
import { primaryColor, neutralColor } from './Colors';

const theme = createTheme({
    palette: {
        primary: {
            main: primaryColor,
            contrastText: "white"
        },
        text: {
            primary: neutralColor
        }
    },
});

export default theme
